        public static string SerializeLeaderboard(Leaderboard2048 leaderboard)
        {
            using (MemoryStream memoryStream = new MemoryStream())
            using (XmlWriter writer = XmlWriter.Create(memoryStream, new XmlWriterSettings
            {
                Encoding = new UTF8Encoding(false), // false = no BOM
                Indent = true
            }))
            {
                // Create an empty namespace to suppress xmlns declarations
                var emptyNs = new XmlSerializerNamespaces();
                emptyNs.Add(string.Empty, string.Empty);
                new XmlSerializer(typeof(Leaderboard2048)).Serialize(writer, leaderboard, emptyNs);
                return Encoding.UTF8.GetString(memoryStream.ToArray());
            }
        }

        public static Leaderboard2048 DeserializeLeaderboard(string xmlString)
        {
            using (StringReader reader = new StringReader(xmlString))
                return (Leaderboard2048)new XmlSerializer(typeof(Leaderboard2048)).Deserialize(reader)!;
        }

        public static string? SerializeLeaderboardEntryById(Leaderboard2048 leaderboard, string id)
        {
            if (!int.TryParse(id, out int idInt))
                return null;

            // Find the lb entry with the specified ID
            Leaderboard2048Entry? entry = leaderboard.GetList?.Entries?.Find(e => e.Id == idInt);

            if (entry == null)
            {
                CustomLogger.LoggerAccessor.LogError($"[LiveLeaderboard2048Class] - SerializeLeaderboardEntryById - Leaderboard entry with ID {id} not found.");
                return null;
            }

            using (MemoryStream memoryStream = new MemoryStream())
            using (XmlWriter writer = XmlWriter.Create(memoryStream, new XmlWriterSettings
            {
                Encoding = new UTF8Encoding(false), // false = no BOM
                OmitXmlDeclaration = true
            }))
            {
                // Create an empty namespace to suppress xmlns declarations
                var emptyNs = new XmlSerializerNamespaces();
                emptyNs.Add(string.Empty, string.Empty);
                new XmlSerializer(typeof(Leaderboard2048Entry)).Serialize(writer, entry, emptyNs);
                return Encoding.UTF8.GetString(memoryStream.ToArray());
            }
        }
